import {Background, LoadingText} from './Styles';
import Spinner from "react-bootstrap/Spinner";


export const Loading = () => {
    return(
        <Background>
            <LoadingText>잠시만 기다려 주세요.</LoadingText>
            <Spinner animation="grow" variant="info" />
        </Background>
        )
};

export default Loading;
